import React from "react";
import { Link } from "react-router-dom";
import { footLinks } from "../constants";

const Footer = () => {
    return (
        <footer className="w-full absolute bottom-0" >
            <ul className="pb-3 mx-auto md:w-6/12 font-thin text-center grid md:grid-cols-7 sm:grid-cols-2 gap-4 text-slate-100 text-sm">
                {footLinks.map((item) => {
                    return (
                        <li className="">
                            <Link to={item.href}>{item.label}</Link>
                        </li>
                    )
                })}
            </ul>
        </footer>
    );
};

export default Footer;
